import React from 'react'

function StateTable() {
    return (

        <div className="container" style={{
            textAlign: "center",
            border: "5px solid gray"
        }}>
            <div className="row">
                <div className="col-9">.col-9</div>
                <div className="col-4">.col-4</div>
                <div className="col-6">.col-6</div>
            </div>
        </div>

    )
}

export default StateTable;
